    stateGetter: function(stateString)
    {
        var edgesDict = {};
        var _this = this;
        var indices = stateString.split("|");
        var sel = { 
            "sex": this.stateLines[0][parseInt(indices[0])] === "Мужчины" ? "male" : (this.stateLines[0][parseInt(indices[0])] === "Женщины" ? "female" : null),
            "bfie": this.stateLines[1][parseInt(indices[1])] === "Всё" ? null : this.stateLines[1][parseInt(indices[1])],
            "bfia": this.stateLines[2][parseInt(indices[2])] === "Всё" ? null : this.stateLines[2][parseInt(indices[2])],
            "bfic": this.stateLines[3][parseInt(indices[3])] === "Всё" ? null : this.stateLines[3][parseInt(indices[3])],
            "bfin": this.stateLines[4][parseInt(indices[4])] === "Всё" ? null : this.stateLines[4][parseInt(indices[4])],
            "bfio": this.stateLines[5][parseInt(indices[5])] === "Всё" ? null : this.stateLines[5][parseInt(indices[5])],
            "self-esteem": this.stateLines[6][parseInt(indices[6])] === "Всё" ? null : this.stateLines[6][parseInt(indices[6])]
        };
        var fitness = function(row) {
            for (var key in row) {
                if (row.hasOwnProperty(key) && sel[key] && sel[key] !== row[key])
                    return false;
            }
            return true;
        };
        var findNode = function(name, klass) {
            for (var i = 0, n = _this.nodes.length; i < n; ++i) {
                if (_this.nodes[i]["label"] === name && _this.nodes[i]["class"] === klass)
                    return _this.nodes[i]["id"];
            }
            return null;
        };
        var addIncEdge = function(src, dst) {
            var key = src.toString() + ":" + dst.toString();
            var e = edgesDict[key];
            if (e) {
                e["weight"]++;
            } else {
                edgesDict[key] = {
                    "source": src,
                    "target": dst,
                    "weight": 1
                };
            }
        }
        var incEdge = function(src, dst) {
            addIncEdge(src, dst);
            addIncEdge(dst, src);
        };
        var addEdges = function(row) {
            var bfie = findNode(row["bfie"], 1);
            var bfia = findNode(row["bfia"], 2);
            var bfic = findNode(row["bfic"], 3);
            var bfin = findNode(row["bfin"], 4);
            var bfio = findNode(row["bfio"], 5);
            var se = findNode(row["self-esteem"], 6);
            var fr = findNode(row["friends"], 7);
            var com = findNode(row["comments"], 8);

            incEdge(bfie, fr);
            incEdge(bfia, fr);
            incEdge(bfic, fr);
            incEdge(bfin, fr);
            incEdge(bfio, fr);
            incEdge(se, fr);

            incEdge(bfie, com);
            incEdge(bfia, com);
            incEdge(bfic, com);
            incEdge(bfin, com);
            incEdge(bfio, com);
            incEdge(se, com);
        };
        var dict2arr = function(dict) {
            var result = [];
            for (var key in dict) {
                if (dict.hasOwnProperty(key))
                    result.push(dict[key]);
            }
            return result;
        };

        for (var i = 0, n = this.rawData.length; i < n; ++i) {
            if (fitness(this.rawData[i]))
                addEdges(this.rawData[i]);
        }

        return { nodes: this.nodes, edges: dict2arr(edgesDict) };
    }
